(404, 1, '2025-01-07 12:34:08', '2025-01-07 12:34:08', '<h2>About us</h2>				\n					<h2>About Company</h2>				\n					<p><b>Vishwabhushan Foundation</b> is a not-for-profit organization committed to uplifting underprivileged communities through impactful programs in healthcare, education, and socio-economic development. Based in the Nimgaon Jali area, the foundation aims to foster charitable, cultural, and humanitarian growth alongside sustainable social progress.</p>\n					        <!-- link opening -->\n                <a href=\"#\">\n                <!-- end link opening -->\n                    <img width=\"45\" height=\"45\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/mission-icon.png\" alt=\"\" />                \n                            <h3>\n                    Our Mission                </h3>\n                        		  <p>To transform the lives of underprivileged individuals by addressing poverty, illness, and lack of opportunities through focused and sustainable interventions.</p>\n                </a>\n					        <!-- link opening -->\n                <a href=\"#\">\n                <!-- end link opening -->\n                    <img width=\"45\" height=\"50\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/vision-icon.png\" alt=\"\" />                \n                            <h3>\n                    Our Vission                </h3>\n                        		  <p>To create a society where holistic development empowers individuals and communities, enabling them to thrive in health, education, and economic independence.</p>\n                </a>\n															<img width=\"655\" height=\"500\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/about_img-2-1-1.jpeg\" alt=\"\" />															\n															<img width=\"309\" height=\"424\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/about_img-1-1.jpeg\" alt=\"\" />															\n							<a href=\"#\" id=\"\">\n					More About				</a>\n					<h2>Core Objectives</h2>				\n											<h3>Healthcare</h3>\n										<a href=\"#\"></a>	\n											<ul><li style=\"font-weight: 400\">Providing healthcare services to underserved communities.</li><li style=\"font-weight: 400\">Implementing lasting solutions to improve health outcomes.</li></ul>						\n											<h3>Education and Skill Development</h3>\n										<a href=\"#\"></a>	\n											<ul><li style=\"font-weight: 400\">Offering support to deserving students for education and research.</li><li style=\"font-weight: 400\">Promoting skill development and leadership training.</li></ul>						\n											<h3>Socio-Economic Development</h3>\n										<a href=\"#\"></a>	\n											<ul><li style=\"font-weight: 400\">Creating sustainable development models for rural and urban areas.</li><li style=\"font-weight: 400\">Generating employment opportunities to enhance livelihoods.</li></ul>						\n					<h2>Our Team</h2>				\n													<img width=\"270\" height=\"420\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/team_img-1-2.jpeg\" alt=\"\" />												\n								<h2>\n																	Charlotte Olivia																</h2>\n								<p>WordPress Dev.</p>\n									<ul>\n			<li>\n			<a href=\"https://facebook.com\" aria-label=\"Facebook\">\n							</a>\n		</li>\n			<li>\n			<a href=\"https://twitter.com\" aria-label=\"Twitter\">\n				<svg aria-hidden=\"true\" viewBox=\"0 0 512 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M459.37 151.716c.325 4.548.325 9.097.325 13.645 0 138.72-105.583 298.558-298.558 298.558-59.452 0-114.68-17.219-161.137-47.106 8.447.974 16.568 1.299 25.34 1.299 49.055 0 94.213-16.568 130.274-44.832-46.132-.975-84.792-31.188-98.112-72.772 6.498.974 12.995 1.624 19.818 1.624 9.421 0 18.843-1.3 27.614-3.573-48.081-9.747-84.143-51.98-84.143-102.985v-1.299c13.969 7.797 30.214 12.67 47.431 13.319-28.264-18.843-46.781-51.005-46.781-87.391 0-19.492 5.197-37.36 14.294-52.954 51.655 63.675 129.3 105.258 216.365 109.807-1.624-7.797-2.599-15.918-2.599-24.04 0