(633, 1, '2025-01-08 11:33:47', '2025-01-08 11:33:47', '<!-- Advanced Slider -->\n					<svg version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" x=\"0px\" y=\"0px\" viewBox=\"0 0 283.4 512\" style=\"enable-background:new 0 0 283.4 512;\" xml:space=\"preserve\"><g><polygon points=\"54.5,256.3 283.4,485.1 256.1,512.5 0,256.3 0,256.3 27.2,229 256.1,0 283.4,27.4 \"/></g></svg>				\n					<svg version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" x=\"0px\" y=\"0px\" viewBox=\"0 0 283.4 512\" style=\"enable-background:new 0 0 283.4 512;\" xml:space=\"preserve\"><g><polygon points=\"54.5,256.3 283.4,485.1 256.1,512.5 0,256.3 0,256.3 27.2,229 256.1,0 283.4,27.4 \"/></g></svg>				\n		<h3>Vishwabhushan Foundation is a people-driven organization – right from the individuals who envisioned and founded it, to the dedicated team working tirelessly to bring about grassroots change, to the supporters who believe in our mission, and most importantly, the people whose lives are transformed through our efforts.</h3><h3>Passionate, committed, and responsible individuals form the backbone of Vishwabhushan Foundation. We see ourselves as catalysts in the journey of driving change, but for true and sustainable development, the initiative must ultimately come from the people themselves.</h3><h3>Over the years, Vishwabhushan Foundation has been blessed with the love, support, and trust of countless individuals. Their unwavering belief in our mission has empowered us to create impactful programs that positively impact over 1.5 million lives annually. We take pride in making our supporters active participants in our initiatives, rather than just contributors of resources, ensuring they become a vital part of the change they wish to see.</h3>		\n					<h2>RECENT ACTIVITIE\'S</h2>				\n		<h4><strong>At Vishwabhushan Foundation, our recent activities reflect our commitment to empowering communities and driving sustainable change. Through our grassroots programs, we have positively impacted thousands of lives, focusing on education, healthcare, and livelihood opportunities. These initiatives were made possible with the active support and participation of our dedicated team and passionate supporters, who continue to stand with us in our mission to create a better future for all. Together, we are turning vision into action, one step at a time.</strong></h4>		\n					<h2></h2>				\n		<a data-text=\"Go\" href=\"#link\">\n									Explore More\n		</a>\n															<img width=\"1024\" height=\"682\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/IMG-20181104-WA0042.jpg\" alt=\"\" />															\n															<img width=\"1024\" height=\"768\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/cy2.jpeg\" alt=\"\" />															\n															<img width=\"1024\" height=\"768\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/224.jpeg\" alt=\"\" />															\n															<img width=\"1024\" height=\"768\" src=\"http://localhost/vbf/wp-content/uploads/2025/01/253.jpeg\" alt=\"\" />															\n					<h2>Enjoy The Best Experience with Us</h2>				\n		<p>Procuring education on consulted assurance in do. Is sympathize he expression mr no travelling. Preference he he at travelling in resolution. So striking at of to welcomed resolved. Northward by described up household therefore attention. Excellence decisively nay man yet impression for contrasted remarkably.</p>', 'INDIVIDUAL SUPPORT', '', 'inherit', 'closed', 'closed', '', '279-revision-v1', '', '', '2025-01-08 11:33:47', '2025-01-08 11:33:47', '', 279, 'http://localhost/vbf/?p=633', 0, 'revision', '', 0),
